func (o *FieldseekerTimecard) Preload(name string, retrieved any) error {
	if o == nil {
		return nil
	}

	switch name {
	case "Organization":
		rel, ok := retrieved.(*Organization)
		if !ok {
			return fmt.Errorf("fieldseekerTimecard cannot load %T as %q", retrieved, name)
		}

		o.R.Organization = rel

		if rel != nil {
			rel.R.Timecards = FieldseekerTimecardSlice{o}
		}
		return nil
	default:
		return fmt.Errorf("fieldseekerTimecard has no relationship %q", name)
	}
}

type fieldseekerTimecardPreloader struct {
	Organization func(...psql.PreloadOption) psql.Preloader
}

func buildFieldseekerTimecardPreloader() fieldseekerTimecardPreloader {
	return fieldseekerTimecardPreloader{
		Organization: func(opts ...psql.PreloadOption) psql.Preloader {
			return psql.Preload[*Organization, OrganizationSlice](psql.PreloadRel{
				Name: "Organization",
				Sides: []psql.PreloadSide{
					{
						From:        FieldseekerTimecards,
						To:          Organizations,
						FromColumns: []string{"organization_id"},
						ToColumns:   []string{"id"},
					},
				},
			}, Organizations.Columns.Names(), opts...)
		},
	}
}

